import axios from 'axios';

export const fetchProduct = async () => {
    const { data } = await axios.get('https://2696e52c-ce6f-43cc-bbbe-46850ab2d273.mock.pstmn.io//api');

    return data;
}

export const fetchRegister = async (input) => {
    const { data } = await localStorage.setItem("input", JSON.stringify(input));

    return data;
}

export default fetchRegister;
